function checkFoundations(tokens,ipavl){terms=ipavl.filter(oer=>oer.category==='Foundations');return countOccurrences(terms,tokens);}
function checkParadigms(tokens,ipavl){terms=ipavl.filter(oer=>oer.category==='Paradigms');return countOccurrences(terms,tokens);}
function checkTechniques(tokens,ipavl){terms=ipavl.filter(oer=>oer.category==='Techniques');return countOccurrences(terms,tokens);}
function checkLanguages(tokens,ipavl){terms=ipavl.filter(oer=>oer.category==='Languages');return countOccurrences(terms,tokens);}
function countOccurrences(terms,list){let total=0;for(let term of terms){for(let item of list){if(item.includes(term.portuguese)){total++;}}}
return total;}
function getOerFoundations(model){let foundations=model.filter(f=>f.foundations>0);return foundations.sort((a,b)=>b.foundations-a.foundations);}
function getOerByTechniques(model){let techniques=model.filter(f=>f.techniques>0);return techniques.sort((a,b)=>b.techniques-a.techniques);}
function getOerByLanguages(model){let languages=model.filter(f=>f.languages>0);return languages.sort((a,b)=>b.languages-a.languages);}
function getOerByParadigms(model){let paradigms=model.filter(f=>f.paradigms>0);return paradigms.sort((a,b)=>b.paradigms-a.paradigms);}
function selectIds(obj,ids){selectedIds=[];ids.forEach((id)=>{auxIds=obj.listFoundations.filter((foundation)=>foundation.id===id);selectedIds=selectedIds.concat(auxIds);auxIds=obj.listTechniques.filter((technique)=>technique.id===id);selectedIds=selectedIds.concat(auxIds);auxIds=obj.listLanguages.filter((language)=>language.id===id);selectedIds=selectedIds.concat(auxIds);auxIds=obj.listParadigms.filter((paradigm)=>paradigm.id===id);selectedIds=selectedIds.concat(auxIds);});return selectedIds;}